package com.syntax.class09;

public class LoopClass {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
	
			 for(int i=0; i<10; i++) {
				 for(int j=0; j<10; j++) {
					 for(int c=0; c<10;c++) {
						 for(int d=0;d<10; d++) {
							 for(int g=0;g<10;g++) {
								 System.out.println(i+""+j+""+c+""+d+""+g);
							 }
						 }
					 }
				 }
			 }
	}

}
